def DateNum(year,month):
    if month==2:
        if (year%4==0 and year%100!=0) or (year%400==0):
            return 29
        else:
            return 28
    elif month==1 or month==3 or month==5 or month==7 or month==8 or month==10 or month==12:
        return 31
    else:
        return 30


